class Solution(object):
    def findLongestWord(self, s, d):
        """
        :type s: str
        :type d: List[str]
        :rtype: str
        """
        n = len(d)
        nxt = [[] for _ in range(26)]
        count = [0] * n
        lens = [len(word) for word in d]
        for i, word in enumerate(d):
            nxt[ord(word[0]) - 97].append(i)

        for c in s:
            temp = nxt[ord(c) - 97]
            nxt[ord(c) - 97] = []
            for i in temp:
                count[i] += 1
                if count[i] != lens[i]:
                    nxt[ord(d[i][count[i]]) - 97].append(i)

        poss = [i for i, c in enumerate(count) if c == lens[i]]
        if not poss:
            return ''
        else:
            mc = max(count[i] for i in poss)
            return sorted([d[i] for i in poss if count[i] == mc])[0]


